		"com/uniorg/cf/banking/example/../../../../../../build/com/uniorg/cf/banking/example/controller/login/Login.controller.js": "\"use strict\";\n\nsap.ui.define(\"com/uniorg/cf/banking/example/controller/login/Login.controller\", [\"sap/ui/model/json/JSONModel\", \"sap/ui/model/Filter\", \"com/uniorg/cf/banking/example/controller/BaseController\"], function (JSONModel, Filter, BaseController) {\n\t\"use strict\";\n\n\treturn BaseController.extend(\"com.uniorg.cf.banking.example.controller.login.Login\", {\n\t\tonInit: function onInit() {\n\t\t\tvar oJSONModel = new JSONModel(\"/apiFinTs/getBanks\");\n\t\t\tthis.getView().setModel(oJSONModel);\n\t\t\tvar formModel = new JSONModel();\n\t\t\tthis.getView().setModel(formModel, \"formModel\");\n\t\t\tthis._loadInfoData();\n\t\t},\n\t\t_loadInfoData: function _loadInfoData() {\n\t\t\tthis.getView().getModel().loadData(\"/login\");\n\t\t\tthis.getView().getModel(\"formModel\").setData({\n\t\t\t\tuser: \"\",\n\t\t\t\tpass: \"\",\n\t\t\t\tblz: \"\"\n\t\t\t});\n\t\t},\n\t\thandleSuggest: function handleSuggest(oEvent) {\n\t\t\tvar sTerm = oEvent.getParameter(\"suggestValue\");\n\t\t\tvar aFilters = [];\n\t\t\tif (sTerm) {\n\t\t\t\taFilters.push(new Filter(\"name\", sap.ui.model.FilterOperator.StartsWith, sTerm));\n\t\t\t\taFilters.push(new Filter(\"blz\", sap.ui.model.FilterOperator.StartsWith, sTerm));\n\t\t\t}\n\t\t\toEvent.getSource().getBinding(\"suggestionItems\").filter([new Filter(aFilters, false)]);\n\t\t},\n\t\tonLogin: function onLogin(evt) {\n\t\t\tvar data = JSON.parse(this.getView().getModel(\"formModel\").getJSON());\n\t\t\tvar blz = this.getView().byId('inputBlz').getSelectedKey();\n\t\t\tconsole.log(blz, data);\n\t\t\tdata.blz = blz;\n\t\t\t$.post(\"/apiFinTs/getAccounts\", {\n\t\t\t\tcode: Base64.encode(data.user + \";\" + data.pass + \";\" + data.blz)\n\t\t\t}, function (data, status) {\n\t\t\t\talert(\"Data: \" + data + \"\\nStatus: \" + status);\n\t\t\t});\n\t\t}\n\t});\n});",
		"com/uniorg/cf/banking/example/../../../../../../build/com/uniorg/cf/banking/example/controller/user/Users.controller.js": "\"use strict\";\n\nsap.ui.define([\"com/uniorg/cf/banking/example/controller/BaseController\", \"sap/ui/model/json/JSONModel\", \"sap/m/MessageToast\"], function (BaseController, JSONModel, MessageToast) {\n\t\"use strict\";\n\n\treturn BaseController.extend(\"com.uniorg.cf.banking.example.controller.user.Users\", {\n\t\tonInit: function onInit() {\n\t\t\tvar oJSONModel = new JSONModel();\n\t\t\tthis.getView().setModel(oJSONModel);\n\t\t\tthis._loadUserData();\n\t\t},\n\n\t\tonAddUser: function onAddUser(oEvent) {\n\t\t\tthis._getDialog().open();\n\t\t\tthis._loadUserData();\n\t\t},\n\n\t\tonDeleteUser: function onDeleteUser(oEvent) {\n\t\t\tvar that = this;\n\n\t\t\tvar oContext = oEvent.getSource().getParent().getBindingContext();\n\n\t\t\tvar id = oContext.getProperty(\"id\");\n\n\t\t\t$.ajax({\n\t\t\t\turl: \"/api/user/\" + id,\n\t\t\t\ttype: \"DELETE\"\n\t\t\t}).done(function () {\n\t\t\t\tMessageToast.show(that.getResourceBundle().getText(\"msgUserDeleted\", [id]));\n\t\t\t\tthat._loadUserData();\n\t\t\t}).fail(function (jqXHR, textStatus, error) {\n\t\t\t\tMessageToast.show(that.getResourceBundle().getText(\"msgError\"));\n\t\t\t});\n\t\t},\n\n\t\tonCloseAddUserDialog: function onCloseAddUserDialog() {\n\t\t\tthis._getDialog().close();\n\t\t\tthis._getDialog().destroy();\n\t\t\tdelete this._oDialog;\n\t\t},\n\n\t\tonSaveAddUserDialog: function onSaveAddUserDialog() {\n\t\t\tvar that = this;\n\n\t\t\tvar id = sap.ui.getCore().byId(\"ipID\").getValue();\n\t\t\tvar userName = sap.ui.getCore().byId(\"ipUserName\").getValue();\n\t\t\tvar lastName = sap.ui.getCore().byId(\"ipLastName\").getValue();\n\t\t\tvar firstName = sap.ui.getCore().byId(\"ipFirstName\").getValue();\n\n\t\t\tif (id === \"\" || userName === \"\" || lastName === \"\" || firstName === \"\") {\n\t\t\t\tMessageToast.show(that.getResourceBundle().getText(\"msgPleaseEnterAllValues\"));\n\t\t\t\treturn;\n\t\t\t}\n\n\t\t\tvar userData = {\n\t\t\t\t\"id\": id,\n\t\t\t\t\"user_name\": userName,\n\t\t\t\t\"last_name\": lastName,\n\t\t\t\t\"first_name\": firstName\n\t\t\t};\n\n\t\t\t$.ajax({\n\t\t\t\turl: \"/api/user/\",\n\t\t\t\ttype: \"POST\",\n\t\t\t\tcontentType: \"application/json\",\n\t\t\t\tdata: JSON.stringify(userData)\n\t\t\t}).done(function () {\n\t\t\t\tMessageToast.show(that.getResourceBundle().getText(\"msgUserAdded\", [id]));\n\t\t\t\tthat._loadUserData();\n\t\t\t}).fail(function (jqXHR, textStatus, error) {\n\t\t\t\tMessageToast.show(that.getResourceBundle().getText(\"msgError\"));\n\t\t\t});\n\n\t\t\tthis.onCloseAddUserDialog();\n\t\t},\n\n\t\tonRefreshUser: function onRefreshUser() {\n\t\t\tthis._loadUserData();\n\t\t},\n\n\t\t_loadUserData: function _loadUserData() {\n\t\t\tthis.getView().getModel().loadData(\"/api/user\");\n\t\t},\n\n\t\t_getDialog: function _getDialog() {\n\t\t\tif (!this._oDialog) {\n\t\t\t\tthis._oDialog = sap.ui.xmlfragment(\"com.uniorg.cf.banking.example.view.user.UserCreate\", this);\n\t\t\t\tthis.getView().addDependent(this._oDialog);\n\t\t\t}\n\t\t\treturn this._oDialog;\n\t\t}\n\n\t});\n});",
